import React, { Component } from "react";
import { Link } from "react-router-dom";

const liStyle = {
  display: "inline",
  margin: "100px 50px",
  fontFamily: "Tahoma",
  textDecoration: "none"
};

const nameStyle = {
  float: "left",
  padding: "25px 50px",
  fontSize: "2em",
  fontFamily: "Tahoma",
  display: "inline"
};

const listStyle = {
  display: "inline",
  margin: "100px 50px"
};

const headerStyle = {
  BackgroundColor: "grey"
};

export class Menu extends Component {
  render() {
    return (
      <div>
        <div style={headerStyle}>
          <div style={nameStyle}>Adam Pikielny</div>
          <ul style={listStyle}>
            <li style={liStyle}>
              <Link to="/code">Code</Link>
            </li>
            <li style={liStyle}>
              <Link to="/videos">Videos</Link>
            </li>
            <li style={liStyle}>
              <Link to="/photos">Photos</Link>
            </li>
          </ul>
        </div>
      </div>
    );
  }
}

export default Menu;
